summary:
My leadership skills have been developed over a 20-year career with global leaders in the manufacturing, supply chain and B2B service industries, expanding my responsibilities through successive promotions in different roles over international teams from Production to Business Development & Marketing and full P&L Management.

Most recently, I was Deputy Chief Operating Officer in the TIC Industry, covering Inspections and Audits with over 1500 employees. On boarded large new clients including major international brands and retailers. Opened a shared-services office in the Philippines with 150 employees in record time. Initiated and implemented plans to reduce costs. Integrated 4 acquisitions over the period, maintaining the client base and delivered high synergies. Boosted the use of data analytics and the digital transformation of the company.

My professional value :
- an agent of change;
- a proven track record in full P&L, Operations management;
- a strong focus on business development and sales growth;
- the ability to quickly analyze a business environment to implement comprehensive strategic plans. I trigger innovation and manage transformation;
- a passion for employee engagement and its power to achieve the goals. Hold people accountable and demand high standards;
- highly proficient in software solutions and digital technologies;
- deep multi-cultural experience having spent during my career over 10 years in North America, 8 years in Asia and 4 years in Europe;
- member of Executive Committee and Board of Directors.

Specialties: P&L Management, General Management, Business Development, Sales Growth, Operations Management, Entrepreneurship, Manufacturing, Digital Transformation, Supply Chain, Quality Control, Compliance, TIC (Testing Inspection Certification), Customer Centricity, Change management, Strategic Plans, Multi-cultural Teams, International Trade, Continuous Improvement, Management under LBO, Private Equity Portfolio Companies, Human Resources.
